var title_f31_51_32570="Electroanatomic mapping NSR";
var content_f31_51_32570=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F75692%7ECARD%2F65810%7ECARD%2F75508%7ECARD%2F56674%7ECARD%2F72406&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F75692%7ECARD%2F65810%7ECARD%2F75508%7ECARD%2F56674%7ECARD%2F72406&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Activation sequence during sinus rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 282px; height: 281px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electroanatomic mapping of the right atrium with the CARTO system during sinus rhythm shows the earliest activation in the region of the sinus node (red), spreading throughout the atrium. The last part to be activated is the region of the tricupid annulus and coronary sinus os (dark blue/purple).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Cooke PA, Wilber DJ. Pacing Clin Electrophysiol 1998; 21:1802.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electroanatomic mapping of atrial tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Activation sequence obtained from electroanatomic mapping of the right atrium (RA) during atrial tachycardia shows the focus of the arrhythmia (red) along the medial mitral annulus, near the coronary sinus (CS). The RA is activated in a retrograde direction and the last portion to be activated is the area near the sinus node (dark blue/purple).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: Marchlinski F, Callans D, Gottleib C, et al. Pacing Clin Electrophysiol 1998; 21:1621.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electroanatomic map of atrial tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 276px; height: 342px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The activation map, in the right anterior oblique projection, was obtained by electroanatomic mapping during atrial tachycardia. The earliest activation, shown in red (arrow), represents the origin of the tachycardia located in the posterolateral right atrium in the region of the crista terminalis. The impulse spreads from this focus (yellow to green to blue), to activate the rest of the right atrium. The last part to be activated is the region around the superior vena cave (SVC) (deep blue).",
"    <div class=\"footnotes\">",
"     TA: tricuspid annulus; IVC: inferior vena cava.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from Marchlinski, F, Callans, D, Gottleib, C, et al, Pacing Clin Electrophysiol 1998; 21:1621.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electroanatomic mapping of ventricular tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 336px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electroanatomic mapping of the left ventricle in the left anterior oblique projection localizes the tachycardia focus to the mid-septal portion (orange area). The pink area is the location where the catheter mechanically terminated the arrhythmia, while the red area is the region where ablation resulted in termination.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from Nademanee K, Kosar EM, Pacing Clin Electrophysiol 1998; 21:1442.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Image fusion with an advanced mapping system",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 417px; height: 351px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown is a three dimensional reconstruction of the left atrium and pulmonary veins obtained from a multislice computed tomography scan. The image is merged with an electroanatomic map that was acquired during a left atrial catheter ablation procedure for atrial fibrillation. Each red dot depicts a site where radiofrequency ablation was performed to create a wide area circumferential confluent lesion around the left and right pulmonary vein pairs. The view is left anterior oblique with the mitral annulus and left atrial appendage facing forward.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bradley Knight MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
