var title_f31_51_32571="Diagnosis of cystic fibrosis";
var content_f31_51_32571=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F72741&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F72741&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for the diagnosis of cystic fibrosis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        One or more typical phenotypic features of CF:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Chronic sinopulmonary disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Characteristic gastrointestinal and nutritional abnormalities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Salt loss syndromes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Obstructive azoospermia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A history of cystic fibrosis in a sibling",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A positive newborn screening test",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         PLUS",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        An elevated sweat chloride concentration on two or more occasions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Identification of mutations in each CFTR gene known to cause CF",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         or",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        In vivo demonstration of characteristic abnormalities in ion transport across the nasal epithelium",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Rosenstein BJ, Cutting GR. J Pediatr 1998; 132:589.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
