var title_f31_51_32573="Ramipril in high risk patients";
var content_f31_51_32573=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74077&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74077&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 513px\">",
"   <div class=\"ttl\">",
"    Ramipril improves the outcome in high risk patients",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 493px; height: 321px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The HOPE trial randomized 9541 patients at high risk for a cardiovascular event to ramipril or placebo; after a 4.5 year follow-up, ramipril significantly reduced the incidence of the composite endpoint of death from cardiovascular causes, myocardial infarction, or stroke (14.1 versus 17.7 percent for placebo, relative risk 0.78, p&lt;0.001).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Yusuf, S, Sleight, P, Pogue, J, N Engl J Med 2000; 342:145.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
